import s from './Components/StyleApp/app.module.css'
import {BrowserRouter, Route} from 'react-router-dom';
import Profile from "./Components/Profile/Profile";
import Header from "./Components/Header/Header";
import Footer from "./Components/Footer/Footer";
import About from "./Components/About/About";
import PizzaOrderContainer from "./Components/Orders/PizzaOrder/PizzaOrderContainer";
import DrinkOrderContainer from "./Components/Orders/DrinkOrder/DrinkOrderContainer";
import SousOrderContainer from "./Components/Orders/SousOrder/SousOrderContainer";
import NewSnekOrderContainer from "./Components/NewOrders/NewSnekOrder/NewSnekOrderContainer";
import NewPizzaOrderContainer from "./Components/NewOrders/NewPizzaOrder/NewPizzaOrderContainer";
import SnekOrderContainer from "./Components/Orders/SnekOrder/SneksOrderContainer";


function App(props) {
    return (

        <BrowserRouter path="/profile">
            <div className={s.App}>
                <Header/>
                <Route path="/about" render={() => <About
                />}/>
                <Route path="/profile" render={() => <Profile
                />}/>
                <Route path="/pizza/:id" render={() => <PizzaOrderContainer/>}/>

                <Route path="/pizzan/:id" render={() => <NewPizzaOrderContainer/>}/>

                <Route path="/sneks/:id" render={() => <SnekOrderContainer/>}/>

                <Route path="/snekn/:id" render={() => <NewSnekOrderContainer/>}/>

                <Route path="/drink/:id" render={() => <DrinkOrderContainer/>}/>

                <Route path="/sous/:id" render={() => <SousOrderContainer/>}/>


                <Footer/>
            </div>
        </BrowserRouter>

    );
}

export default App;
